import React from "react";

import classes from "./Contact.module.css";

const Contact = (props) => {
  return (
    <li className={classes.contact}>
      <h2>{props.name}</h2>
      <h3>{props.favorite}</h3>
      <p>{props.number}</p>
    </li>
  );
};

export default Contact;
